#mensaje=''
mensaje=''
fila=[]
while mensaje != '':
    #fila.append(mensaje[:96])
    #mensaje=mensaje[96:]
    fila.append(mensaje[:104])
    mensaje = mensaje[104:]
binario=''
for i in range(0, len(fila)):
    iporigen=fila[i][0:32]
    #ipdestino=fila[i][64:96]
    ipdestino = fila[i][72:104]
    nropaquete=fila[i][32:40]
    #binario=binario+fila[i][40:64]
    binario = binario + fila[i][40:72]

binary_int = int(binario, 2)
byte_number = binary_int.bit_length() + 7 // 8
binary_array = binary_int.to_bytes(byte_number, "big")
ascii_text = binary_array.decode()
print('el mensaje es :',ascii_text)